Country: France
Directed by: Carmen &amp; Gonzag
Studio: Federation Francaise De Q
Starring: Amateurs Libertins
Duration: 83 min

Gonzag &amp; Carmen, reporters libertins bien connus des milieux coquins vous ouvrent les portes des clubs les plus prises de France: Le Mas De Virginie, un lieu paradisiaque dans la Drome qui mele balneo, piscine naturiste, discotheque et coins calins, le Betty's qui enflamme les nuits auvergnates, et le legendaire &quot;Glamour&quot; au Cap d'Agde qui attend pres de 1000 couples pour son reveillon. Plongez au coeur des soirees chaudes, rencontrez les acteurs incontournables de ce milieu tres discret, et soyez les temoins privilegies de moments coquins
